import React from 'react';
import './FilmStripEdges.css';

const FilmStripEdges = () => {
  // Replace with your own images
  const pictures = [
    { src: '/images/photo1.jpg', alt: 'Funny faces' },
    { src: '/images/photo2.jpg', alt: 'Vacation moment' },
    { src: '/images/photo3.jpg', alt: 'Silly hat' },
    { src: '/images/photo4.jpg', alt: 'Romantic shot' },
  ];

  return (
    <>
      {/* Left Strip */}
      <div className="film-edge film-edge-left">
        {/* Optional Title or decoration at the top */}
        <div className="film-strip-title">Our Memories</div>
        {pictures.map((pic, idx) => (
          <div className="photobooth-frame" key={`left-${idx}`}>
            <img src={pic.src} alt={pic.alt} />
          </div>
        ))}
      </div>

      {/* Right Strip */}
      <div className="film-edge film-edge-right">
        <div className="film-strip-title">Fun Times</div>
        {pictures.map((pic, idx) => (
          <div className="photobooth-frame" key={`right-${idx}`}>
            <img src={pic.src} alt={pic.alt} />
          </div>
        ))}
      </div>
    </>
  );
};

export default FilmStripEdges;
